Set the active view.

Example defaultView / views configuration

    defaultView: 'day',
    views: {
        day: {
            xtype: 'calendar-day'
        },
        week: {
            xtype: 'calendar-week'
        }
    }

To change the view from the default of "day" to "week":

    ViewInstance.setView('week');
